import './App.css';
import skincareWomanImage from './skincare_woman.jpeg';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <div className='fbask-reg text-3xl border-b-black border-b-2'>
        <div className='flex justify-between'>
            <Link to="/">
                <div>
                    <button className='fbask-reg p-4 mx-32'>
                        Skin
                    </button>
                    <button className='fbask-ital p-4 mx-32'>
                        Match
                    </button>
                </div>
            </Link>
            <Link to="/camera">
                <button className='p-4 mx-32'>
                    Camera
                </button>
            </Link>
        </div>
    </div>
  );
}

export default Navigation;
